"Dispozitivul s-a supraîncălzit. Pentru a se evita deteriorarea, acesta s-a oprit.

Supraîncălzirea poate fi cauzată de:
- Utilizarea îndelungată a aplicațiilor cu un nivel intens de grafică, de exemplu, jocuri și aplicații de navigare;
-Transferul fișierelor mari;
- Utilizarea dispozitivului într-un mediu cu temperatură ridicată."

